import React from "react"

class PrikazKarte extends React.Component{

    constructor(){
        super()
        this.state = {
            projekcija:""
        }
    }

    componentDidMount(){
        this.setState({projekcija:this.props.projekcija})
    }

    render(){
        return(
            <div>
                <h1>Prikaz karte!</h1>
            </div>
        )
    }
}

export default PrikazKarte
